  fullName: System.Drawing.Drawing2D.CompositingQuality
  type: Enum
  summary: "Angir kvaliteten som skal brukes under sammensetting."
  remarks: "Sammensetting er utført under gjengivelse når kilden piksler kombineres med målet piksler til å produsere resulterende piksler. Kvaliteten på sammensetting direkte er knyttet til den visuelle kvaliteten på resultatet og er motsatte av stoppene proporsjonalt gjengivelse tid. Jo høyere kvalitet, reduseres gjengivelse tiden. Dette er fordi Jo høyere kvalitetsnivået, mer omkringliggende piksler må tas hensyn under sammensatt. Lineær kvalitet innstillingen (AssumeLinear) kompromissene ved å gi bedre kvalitet enn standard kvaliteten på en litt lavere hastighet."
